# 钓鱼类
class GoFishing:
    fish: str = None  # 鱼类
    coins: str = '+0'  # 鱼币
    experience: str = '+8'  # 经验
    fishingRod: str = '普通钓竿'  # 钓竿

    def __init__(self, sendId):
        self.sendId = sendId  # 获取当前游戏的账号
        gamedata = db.find(self.sendId)  # 找出此账号的数据
        a = [v for k, v in gamedata.items() if k=='go_fishing'][0]  # 获取当前行为类对应的数据，之后赋值给对应的类变量
        vLst = list(a.values())  # 获取数据的值列表

        self.fish = vLst[0]
        self.coins = vLst[1]
        self.experience = vLst[2]
        self.fishingRod = vLst[3]

    def goFishing(self):  # 钓鱼
        fishRuslt = random.choices(smallLst, [0.444, 0.333, 0.222, 0.001])
        for fs, prc, experience in smallFish.items():
            if fishRuslt==fs:
                self.fish = fs+f'{prc}鱼币/条'
                self.coins = f'+{prc}'
                self.experience = f'+{experience}'
                self.fishingRod = '普通钓竿（一钓一鱼）'





    def goBank(self):  # 银行
        pass

    def personalCenter(self):  # 个人中心
        pass

    def explorationSea(self):  # 出海探险
        pass

    def pirateRaid(self):  # 海盗突袭
        pass


