# 呼出游戏
@oncommand(promat=[".", "/", '~'], cmd=["钓个鱼"])
def handle(netpackage):
    # 防封控，概率发送消息
    robot_msg = [f"[CQ:at,qq={netpackage.user_id}]恭喜您获得普通钓竿\n命令：@有鱼诶", ' ', f'#@$@%$^%&$%*&@#^%(&)_|>?<>']

    result = random.choices(robot_msg, [0.5, 0.2, 0.3])

    db = DataStorage()  # 注册实例对象
    db.create('libs/db/data/beta.db')  # 创建

    # 初始化数据格式
    gameData = {netpackage.user_id: {'group_id': netpackage.group_id,
                'personal_center': {'fishing_level': None, 'wallet_coins': None,
                                    'bank_deposit': None},
                'go_bank': {'wallet_coins': None, ' bank_deposit': None, 'interest': None,
                            'yesterday_earnings': None, 'transfer_limit': None},
                'go_fishing': {'fish': None, 'coins': None, 'experience': None,
                               'fishing_rod': None},
                'exploration_sea': {'this_time_coins': None, 'wallet_coins': None},
                'pirate_raid': {'raidResult': None}
                }}



    db.open('libs/db/data/beta.db')

    # 判断是否为第一次游戏
    if db.find(netpackage.user_id) == None:
        gameData = {netpackage.user_id: {'group_id': netpackage.group_id,
                                         'personal_center': {'fishing_level': 1, 'wallet_coins': 0,
                                                             'bank_deposit': 0},
                                         'go_bank': {'wallet_coins': 0, ' bank_deposit': 0, 'interest': '1%',
                                                     'yesterday_earnings': 0, 'transfer_limit': 50000},
                                         'go_fishing': {'fish': None, 'coins': None, 'experience': None,
                                                        'fishing_rod': '普通'},
                                         'exploration_sea': {'this_time_coins': None, 'wallet_coins': None},
                                         'pirate_raid': {'raid_result': None}
                                         }}
        db.write(gameData)
        print('这是新账号····')

    print(db.find(netpackage.user_id))

    db.close()


    try:
        sendGroupMsg(gid=netpackage.group_id, text=result)
    except:
        pass

    print("hello emiya")


@oncommand(promat=["@", '！！', '~'], cmd=["有鱼诶"])
def fish(netpackage):
    role = Role(sendId=netpackage.user_id)

    data = (f'[CQ:at,qq={netpackage.user_id}] 哇！有鱼上钩了耶~~\n鱼类：{role.fish}\n鱼币：{role.coins}'
            f'\n经验：{role.experience}\n钓竿：{role.fishingRod}')
    pic = f'{data}\n[CQ:image,file={bs64},subType=0]'

    try:
        sendGroupMsg(gid=netpackage.group_id, text=pic)
    except:
        pass



